import React, { Component } from 'react';

export default class AboutA extends Component {
  render() {
    return (
      <>
      <div className="Woola_about-banner main-banner">
	<h3> About Us</h3>
</div>
   
    <AboutB />
    </>
    );
  }
}

class AboutB extends React.Component{
  render() {
    return (
     <>
        <div className="eco-friend">
	<div className="container">
		<div className="row">
			<div className="col-md-6 aos-init aos-animate" data-aos="fade-right">
				<h2> Welcome to New Zealand, land of the long white cloud</h2>
				<p>Here in New Zealand, we are striving to keep our country green, sustainable, and beautiful. We found an increasing desire for products made from natural products that were sustainably sourced. From this Woola was born. Starting with pillows the range quickly grew to include mattresses, bases, duvets, and overlays. We export this range right across the globe.  </p>
		
			</div>
			<div className="col-md-6 aos-init aos-animate" data-aos="fade-left">
           
				<img src="https://www.woola.co.nz/wp-content/uploads/2021/05/eco-bne-1.png"/> 
				<div className="cust_about_video">
			<div id="wistia_72.thumb_container" className="wistia_click_to_play">
                       <a className="" href="#"><img src="https://www.woola.co.nz/wp-content/uploads/2021/05/Group-13892.png"/></a> 
                   </div>
               </div>
			</div>
		</div>
	</div>
</div>
<AboutC />
      </>
    );
  }
}

class AboutC extends React.Component{
  render() {
    return (
     <>
        <section className="icon-about-us">
	<div className="container">
		<div className="row">
		
			<div className="col-md-4 aos-init aos-animate" data-aos="zoom-down">
				<div className="w-100 text-center">
					<img src="https://www.woola.co.nz/wp-content/uploads/2021/05/icon1.png"/>
					<h3>Natural Materials</h3>
					<p> Products made with natural materials</p>
					<a href="" className="rule-link rule-link-trigger1">Read More...</a>
				</div>
			</div>
			<div className="col-md-4 aos-init aos-animate" data-aos="zoom-down">
				<div className="w-100 text-center">
					<img src="https://www.woola.co.nz/wp-content/uploads/2021/05/icon2.png"/>
					<h3>Completely Sustainable</h3>
					<p> All natural materials must be sustainably sourced.</p>
					<a href="" className="rule-link rule-link-trigger2">Read More...</a>
				</div>
			</div>
			<div className="col-md-4 aos-init aos-animate" data-aos="zoom-down">
				<div className="w-100 text-center">
					<img src="https://www.woola.co.nz/wp-content/uploads/2021/05/icon3.png"/>
					<h3>Totally New Zealand</h3>
					<p> All products are hand crafted in New Zealand by New Zealanders</p>
					<a href="" className="rule-link rule-link-trigger3">Read More...</a>
				</div>
			</div>
			<AboutD />
		</div>
	</div>
</section>

      </>
    );
  }
}

class AboutD extends React.Component{
	render() {
	  return (
		  	   <>
		 
  
		</>
	  );
	}
  }
